import React from "react";
import "./Education.css";

const Education = () => {
  return (
    <div className="eduContainer">
      My Educational Qualifications are,
      <div className="degree">B.Tech in the stream of Computer Science and Engineering at Sri V</div>
      <div className="inter">12th</div>
      <div className="ssc">10th</div>
    </div>
  );
};

export default Education;
